    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_01_LINZEY", "Our journey is NOT pointless, Goth Boy!", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_02_BUDDY", "Yeah, pal! We're on a special quest for King Roland.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_03_GOTHBOY", "Fine. But quest or not, life is just darkness and despair.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_27_GOTHBOY", "Oh, gross. No way. Look, you really want to know what life is all about? Just head to that dark castle way over there.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_28_GOTHBOY", "That's Castle Morcubus, home to a terrible wizard. In his private library is an ancient book that is said to hold the secret to life itself.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_29_GOTHBOY", "Find that book, and you'll find out what life is all about.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_30_BUDDY", "Neat! I want to learn the meaning of life!", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_31_LINZEY", "Alright, Goth Boy, you're on! We'll go to that evil castle and find the ancient book! Are you in?", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_32_GOTHBOY", "Sure. I'd love to see the look on your face when you find out life is pointless.", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_INTROTWO_44_GOTHBOY", "Just follow me...", "GothBoyIntroTwo dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_01_YUKI", "BLARRRAGH!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_02_LINZEY", "What the--?!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_03_YUKI", "Nyah nyah nyah blehhhhhhhhh!!!!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_04_GOTHBOY", "C'mon, Yuki, knock it off.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_05_YUKI", "Oh! Hiiiiiii, Goth Boyyyyyy...", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_06_GOTHBOY", "Just let us get through, already!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_07_YUKI", "Who's your friend, Goth Boy?", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_08_YUKI", "You're cute!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_09_YUKI", "I wanna bite your face!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_10_BUDDY", "Thanks!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_11_GOTHBOY", "No biting.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_12_YUKI", "THEN BRING ME SHINYS!!!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_13_YUKI", "Pay the toll and you may pass. If you don't...", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_14_YUKI", "...bites on the face!!!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_15_BUDDY", "She seems nice.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_16_LINZEY", "You think EVERYONE'S nice!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_17_BUDDY", "I think you're mean, sometimes.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_18_LINZEY", "Look, in order to get through, we need to hunt down all the shiny things we can.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_19_LINZEY", "I see a lot of things shining over there in those ruins.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_20_LINZEY", "Let's collect all the shinys we can. $PLAYERNAME$ can place blocks to climb up to the hard to reach ones.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_21_GOTHBOY", "You're gonna do it? That's so stupid! Let's just run past her. She can't bite all of us!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_22_BUDDY", "She's still someone who needs our help, Goth Boy.", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_SPOOKANE_YUKITROLL_23_GOTHBOY", "Fine, whatever! Helping people is such a waste of time! Let's just do it quickly!", "YukiTroll dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_01_BUDDY", "Here, Guillermo! Over here, boy!", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_02_BUDDY", "It's from King Roland! 'Dear $PLAYERNAME$,'", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_03_BUDDY", "'News of your deeds is spreading like strawberry icing over a moist, chocolate cupcake. Well done!'", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_04_BUDDY", "'It seems you have accomplished much in a very short time! Everyone back home is very proud.'", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_05_BUDDY", "Wow! King Roland sounds pretty happy, $PLAYERNAME$! He threw in a bunch of rewards and even a new map--", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_06_LINZEY", "NEW MAP?! Omigosh, hand it over right now!!!", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_07_LINZEY", "Rocket Reef? Sounds exciting! Once we're done here we should check it out!", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_08_LINZEY", "I guess that old pigeon can be useful after all...", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_09_BUDDY", "Thanks, pal!", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTWO_10_LINZEY", "Alright, $PLAYERNAME$, let's get back to it!", "KP Level 2 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_02_LINZEY", "Ooh, I hope Guillermo's bringing more maps!", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_03_BUDDY", "'Dear, $PLAYERNAME$. I've heard about all of your hard work, and I have fantastic news!'", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_04_BUDDY", "'I've discovered a brand of fat-free cupcakes that taste just as good as the original!'", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_05_BUDDY", "'Oh, also I'm giving you some more rewards and new maps!'", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_06_BUDDY", "Yikes! Don't hurt me, Lyndsay! I'll give you the maps right away!", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_07_LINZEY", "Relax, Buddy. I don't freak out EVERY time I see a map.", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_08_LINZEY", "OMIGOSH THESE MAPS ARE AWESOME!!!", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELTHREE_09_LINZEY", "$PLAYERNAME$, as soon as we're done here let's go explore!", "KP Level 3 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_02_LINZEY", "So where is he?", "KP Level 4 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_03_BUDDY", "I guess he's late!", "KP Level 4 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_04_GUILLERMO", "Chitter-chit! Chitter-chitter!", "KP Level 4 dialog")
