    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_06_BUDDY", "'Dear, $PLAYERNAME$. CRISIS! I finally tried a cupcake I didn't like! I don't know what to do!'", "KP Level 4 dialog")
