    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_08_BUDDY", "'That raised my spirits considerably! Well done! The Kingdom's in better shape than ever! The standard rewards and maps are attached.'", "KP Level 4 dialog")
    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_09_BUDDY", "'ps. Please ask Buddy if he wants the rest of my lychee cupcakes. I can't face them!'", "KP Level 4 dialog")
