    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFOUR_13_BUDDY", "$PLAYERNAME$ can decide when we're back at the boat. Thanks again, Guillermo!", "KP Level 4 dialog")
