    UIEngineUtils:AddTemporarilyToLocTable("STRING_IGC_KINGPOINTS_LEVELFIVE_05_LINZEY", "You had Guillermo bring you a GRILLED CHEESE SANDWICH?!", "KP Level 5 dialog")
